import { Link } from "react-router-dom";

const DUMMY_EVENTS = [
    {
        id: 'e1',
        title: 'Some event'
    },
    {
        id: '2e',
        title: 'Another event',
        to: '/events/new'
    }
];

function EventPage() {
    return (
        <>
            <h1>EventPage</h1>
            <ul>
                {DUMMY_EVENTS.map((event) => <li key={event.id}>
                    <Link to={event.id}>{event.title}</Link>
                </li>)}
            </ul>
        </>
    );
};

export default EventPage;
